Extend c# APIs for BUILD demo:

1.  Add "AppendAzureEP" for SessionOption;
2.  Add "Run(byte[])" for InferenceSession;

Sample client code:

```
var session_option = new SessionOptions();
session_option.AppendAzureEP(<uri string>, <key string>);
var session = new InferenceSession(<path to model>, session_option); // model will not be load locally
byte[] input_bytes = ...//convert image to byte[]
try {
  byte[] output_bytes = session.Run(input_bytes);
}...
```

**Description**: 
Optimized SkipLayerNormKernel for ROCm.


**Motivation and Context**
The performance gap is observed in SkipLayerNorm kernel with the [microbenchmark](https://github.com/microsoft/onnxruntime/blob/master/onnxruntime/python/tools/microbench/skip_layer_norm.py) on MI200 vs. A100. With the optimized kernels, we are able to see the significant performance improvement compared to A100. In addition, SkipLayerNormKernel has been moved to contrib_ops/rocm instead of relying on hipify process. This may help further AMD-specific optimizations in the future.


The perf numbers in the below table were collected on MI200 with various input tensor sizes.

