(1) change the default kernel to use compact memory since it faster (in most cases) and uses less GPU memory.
(2) Rename fast kernel to simple kernel to avoid confusion since it is slower than the compact memory kernel in most cases.
(3) Remove a cuda stream synchronize that is not needed.
(4) Update longformer benchmark tool
     (a) output more accurate GPU memory used. It is because default Arena memory strategy could allocate more memory than needed, so we change the arena strategy during testing memory.
     (b) Output the percentile of result difference between PyTorch and OnnxRuntime
